import React from 'react'
import {Col,Button} from 'react-bootstrap'

const Cell = (props) => {

    return <Col onClick={props.selectCell(props.id)}>
        {props.selected ? props.selected.image : <Button>"Click Here"</Button>}
    </Col>
}

export default Cell;
